function createList(n){return n.length>0&&$("#noData").remove(),$.each(n,function(n,t){var r="#list",i="#item"+t.id;$("#CloneRowObject").clone().appendTo(r);$(r).find("#CloneRowObject").removeClass("hidden").data("id",t.id).attr("id","item"+t.id);$(i).find("#name").append(t.title);$(i).find("#sku").append(t.sku);$(i).find("#price").append(t.price);$(i).find("#categories").append(t.categories);$(i).find("#title").append(t.title);$(i+" a.link").attr("href",$(i+" a.link").attr("href")+t.id)}),$("#main-wrapper").fadeIn(500),!0}$(document).ready(function(){$("#navigation #navProducts").addClass("active").parents("li").addClass("active").addClass("open").find(".sub-menu").slideDown();$.ajax({url:"/api/products",dataType:"json",type:"get",contentType:"application/json;",success:function(n){return createList(n.value),!0},error:function(n){if(n.status===401||n.status===403)toastr.warning("You are unauthorized to do this. You will be redirected to the login screen."),setTimeout(function(){location.href="/"},4500);else{var t=n.responseJSON.value;t.redirect!==null&&typeof t.redirect!="undefined"&&(location.href=t.redirect);toastr[t.messageType](t.message)}return!0}})});